import {FETCH_DRIVERS, DriversState} from "./types";
import { DriversAction} from "./types";

const initalState: DriversState = {
    state: []
}

export const driversReducer = (state = [], action: DriversAction) => {
    switch (action.type) {
        case FETCH_DRIVERS:
            return action.payload
    }
};
